pragma solidity ^0.8.0;

interface AggregatorV3Interface {
  function decimals() external view returns (uint8);

  function description() external view returns (string memory);

  function version() external view returns (uint256);

  function getRoundData(uint80 _roundId)
    external
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    );

  function latestRoundData()
    external
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    );
}
","keccak256":"0x6e6e4b0835904509406b070ee173b5bc8f677c19421b76be38aea3b1b3d30846","license":"MIT"},"contracts/mocks/PriceFeed.sol":{"content":"// SPDX-License-Identifier: No-License
pragma solidity 0.8.17;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "hardhat/console.sol";

contract PriceFeed {
    address internal owner;
    mapping(address => AggregatorV3Interface) internal priceFeeds;

    modifier onlyOwner() {
        require(
            msg.sender == owner,
            "Only the owner of this smart contract can execute this action."
        );
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function addAssetOracle(address _asset, address _oracle)
        external
        onlyOwner
    {
        priceFeeds[_asset] = AggregatorV3Interface(_oracle);
    }

    function getAssetPrice(address _asset) external view returns (uint256) {
        (, int256 price, , , ) = priceFeeds[_asset].latestRoundData();
        return uint256(price);
    }
}
